import { geoEqualEarth, geoPath } from 'd3';

const projection = geoEqualEarth();
const path = geoPath().projection(projection);

export const Marks = ({ data }) => (
    <g className="map">
        <path className="map-sphere"
            d={path({ type: 'Sphere' })}
        />

        {data.features.map(feature => (
            <path
                className="map-plot" 
                d= {path(feature)}
            />
        ))}


    </g>
);
